<html><body><div text=align:justify><div align=center><H2 style="margin-left: auto; margin-right: auto;"> ХАРАКТЕРИСТИКА </H2> </div><br>	Филатова Фёкла Михайловна родится одиннадцатого ноября 2092. <br><p>Двадцать седьмого июня 2966 устроится на работу в Фонд на должность  менеджера по работе с клиентами. </p><p>	Окончательно уволится двадцать четвертого мая 2443. </p><p>Дата созадния документа 12.02.2023</p></div></body></html>
